      "id":"fs-1-20220427195232","type":"fold","label":"","title":"종교의 지도자와 이성주의자가 맞붙는다. ","description":"신을 잃어버린 정진수는,\\n인간에게 적합한 신의 의도를 \\n직접 만들어내려고 합니다. \\n그래서 진경훈의 딸 진희정에게 의도적으로 \\n접근해 희정의 어머니를 죽인 살인마를\\n, 함께 살해합니다. 그리고 사체를 시연당한 것처럼\\n 꾸며 자신의 논리를 강화시키는데 이용합니다\\n. 다시 말해 큰 죄를 저지른 악인이 시연당한 것처럼 \\n꾸며 공포에 질린 대중들이 죄를 저지르지 \\n않는 세상이 더욱 나은 세상이라고 믿고 있는거죠\\n 실제 그는 새로운 종교를 창시할 준비가 되었습니다\\n. 박정자의 집은 성지가 되어 신의 강림을 기념하고 \\n, 자신이 쓴 책은 새로운 시대의 경전이됩니다.\\n 마지막으로 세상모든 사람들이 \\n신도로 만들 계획을 세웁니다\\n\\n 이순간 성훈은 선택을 해야합니다. \\n시연은 아무런 의미도 없고, 그저 자연재해에\\n 불과하다는 것,   신이 있다면 주사위를 돌려가며\\n 사람을 죽여가는 미치광이라는 \\n진실을 널리 알리는 것 그 결과\\n는 악마 같은 인간을 처형한 죄로 자\\n신의 딸은 살인자로 낙인 찍힌 채 법의 처벌을 받게 되겠죠. \\n결국, 경훈은. 정진수가 준비한 세상에\\n서 딸과 함께 살아가는것을 선택합니다. \\n인간이 쌓아올린 이성과 자유의지를\\n 포기하고, 정진수가 준비한 새로운 세상을 맞이 합니다\\n","imageId":"3569ab21-74d6-46ee-0adf-48910c1a1f00","original":{"source":"youtube","videoId":"PYpPLaNLRWQ","url":"https://www.youtube.com/watch?v=PYpPLaNLRWQ","isScrapping":true,"metadata":{"title":"《지옥》 이해하면 충격적인 결말 디테일 설정 총 정리!! (스포주의) - YouTube","description":"#지옥결말 #지옥디테일 #지옥해석안녕하세요 오늘은 넷프릭스에서 최근 공개된 드라마 지옥에 대한 리뷰입니다지옥은 다양한 방식으로 해석될 여지가 있는 드라마입니다저와 해석이 다른 분들은 리플로 남겨주세요!지옥은  넷플릭스에서 보실 수 있습니다문의 adclosetman@gmail.com","keywords":"동영상, 공유, 카메라폰, 동영상폰, 무료, 올리기","ogImage":"https://i.ytimg.com/vi/PYpPLaNLRWQ/hqdefault.jpg","ogTitle":"《지옥》 이해하면 충격적인 결말 디테일 설정 총 정리!! (스포주의)"}},"uid":1,
