      "id":"fz-1-20220427195047","type":"fold","label":"","title":"종교의 교주, 연쇄 살인마 음악가, 찰스맨슨 ","description":"직접 살인을 하지 않았지만, 세계에서 가장 유명한 \\n연쇄살인마이자. \\n비틀즈와 요한계시록을 결합하고\\n인종전쟁을 예견한 \\n사이비 종교의 교주 \\n찰스 맨슨에 관해 알아보자\\n","imageId":"f70f5023-dfb2-46bd-85df-a3213138c200","original":{"source":"youtube","videoId":"3W39DSntn7g","url":"https://youtu.be/3W39DSntn7g?t=163","isScrapping":true,"metadata":{"title":"역대 살인마 찰스 맨슨 인터뷰 - YouTube","description":"질문이 사람들이 25년 후인 지금 보아도 당신이 누군지 갈피를 잡지 못합니다.당신은 자신을 어떻게 생각을 합니까 였는데요.그는그 누구도 아니야난 그 누구도 아니야부랑자, 거지, 떠돌이일꾼, 박스카, 와인통등...내가 너무 가까이 다가온다면 날카로운 면도칼이 될 수도 있지... 라는...","keywords":"찰스맨슨, 사이코패스, 연쇄살인, 악마의씨, Psychopath, serial, killer, Charles, Manson","ogImage":"https://i.ytimg.com/vi/3W39DSntn7g/hqdefault.jpg","ogTitle":"역대 살인마 찰스 맨슨 인터뷰"}},"uid":1,
