      "id":"fs-1-20220427195105","type":"fold","label":"","title":"프로파일링의 시작!  실제 살인마의 모습과 마인터 헌터에서의 차이는?","description":"1970년대 FBI에서 시작한 프로파일링 프로젝트\\n실제 살인마를 인터뷰하며 그들 마음 속 숨겨진 어둠을 파헤친다\\n전설적인 사이비 교주 찰스맨슨의 실제 모습과 \\n드라마속 보여지는 그의 장면 분석","imageId":"dcff7d32-954d-4791-541a-7707ab7cc300","original":{"source":"youtube","videoId":"4fmPVcgpHeM","url":"https://www.youtube.com/watch?v=4fmPVcgpHeM","isScrapping":true,"metadata":{"title":"Mindhunter Season 2 - Charles Manson Interview | 60 Minutes Australia | Side By Side - YouTube","description":"Disclaimer: None of the clips are mine. All credits go to the show creators from Mindhunter and 60 Minutes Interview AustraliaLeft side: Charles Manson Inter...","keywords":"mindhunter, mindhunter season 2, charles manson, Holt McCallany, Jonathan Groff, Damon Herriman, Holden Ford, Anna Torv, Wendy Carr, Tom Snyder, Side by side comparison, mindhunter netflix, David Fincher","ogImage":"https://i.ytimg.com/vi/4fmPVcgpHeM/maxresdefault.jpg","ogTitle":"Mindhunter Season 2 - Charles Manson Interview | 60 Minutes Australia | Side By Side"}},"uid":1,
