      "id":"fold-1-20220611140725","type":"fold","uid":1,"label":"","title":"추리소설의 계보학","description":"추리소설은 수수께끼를 던집니다. 범인이 누구인가?  왜 범죄를 저지르고 어떻게 빠져나갔는가?  또 탐정은 무엇을 보고 사건을 해결할 수 있었는가?\\n\\n작가는 이런 저런 다양한 궁금증을 던져주고 독자에게 일종의 도전을 합니다. 이를 통해 독자는 ‘범인 미리 맞추기’를 즐기실 수도있고, 범죄 행위 자체에서 서스펜스를 느낄수도, 풀리지 않는 궁금증에 미스터리를 빠질 수 있을겁니다\\n\\n추리소설은 과거부터 매우 인기있는 소설의 한 장르였습니다 바로 이 폴드에서 추리소석의 계보학을 연결해가며 추리소설의 모든것을 엮어보려합니다\\n\\n","imageId":"aefc6cb8-4447-4538-d58e-65cc0cadd600","original":{"source":"youtube","videoId":"","url":"","isScrapping":false,"metadata":{}},"foldNode":{"title":"추리소설의 계보학","description":"추리소설은 수수께끼를 던집니다. 범인이 누구인가?  왜 범죄를 저지르고 어떻게 빠져나갔는가?  또 탐정은 무엇을 보고 사건을 해결할 수 있었는가?\\n\\n작가는 이런 저런 다양한 궁금증을 던져주고 독자에게 일종의 도전을 합니다. 이를 통해 독자는 ‘범인 미리 맞추기’를 즐기실 수도있고, 범죄 행위 자체에서 서스펜스를 느낄수도, 풀리지 않는 궁금증에 미스터리를 빠질 수 있을겁니다\\n\\n추리소설은 과거부터 매우 인기있는 소설의 한 장르였습니다 바로 이 폴드에서 추리소석의 계보학을 연결해가며 추리소설의 모든것을 엮어보려합니다\\n\\n"},
