      "id":"fs-1-20220427200705","type":"fold","label":"","title":"알면 소름돋는 지옥 결말 해석 ","description":"지옥의 결말의 의미는 뭘까?. 배영재와 송소현.\\n 튼튼이의 부모는 자신의 아이를 살해하려 온\\n 지옥의 사자들에 맞서, 튼튼이의 몸을 \\n감싸안고 버팁니다. 그런데 이 초자연적 존재들은\\n, 튼튼이를 시연하는 것이 아닌 \\n배영재와 송소현을 살해하고 떠나버리게 됩니다.\\n 그럼 우리는 이 결말을 어떻게 해석해야하는가?\\n \\n첫번째, 우리에게 친숙한 종교적이고 인격적인 신! \\n다시말해 예수와 같은 신이 존재해서, \\n자신의 생명을 희생하면서까지 자식을 지키려는\\n 숭고한 인간의 모습을 보고, 마침내\\n 이 끔찍한 살육을 멈추었다고 볼 수도 있습니다. \\n 신이 원했던 것은, 엄격하게 종교적 계율을 지키는\\n 것도 아니고, 공포에 짓눌려 억지로 선하게 사는\\n 것도 아니었습니다. 오히려 희생 사랑과 같은  \\n인간적인 감정을 최대로 발휘하는 것을 원했을 수 있죠.\\n 이것이 신이 인간에게 자유의지를 내려준 \\n진짜 이유였을지도 모르고요 \\n원작에는 없지만 드라마에서 추가된 박정자가 \\n부활하는 장면 역시, 신의 의도가 마침내 세상에서\\n 구현되자, 희생양 삼았던 박정자를 다시\\n 살려낸 것으로도 볼 수 있습니다\\n\\n두번째 신은 악한 존재이기 때문에 인간세계의 \\n혼란과 고통을 주기위해 의도적으로 튼튼이를 \\n살렸다는 생각도 해볼 수 있습니다. \\n사실 지옥에서 그려진 고지를 받은 사람 중 \\n진짜 죄인은 단 한명도 없습니다. 굳이 죄인을\\n찾자면 어머니를 죽인 살인마를 살해한, \\n진희경과 정진수 정도겠죠. 하지만 정진수는 \\n죄를 저지르기도 전에 고지를 받았고, 진희경은\\n 아직 고지를 받지 못했습니다. 오히려 고지와 \\n시연을 통해, 현실 세상이 진짜 지옥이 되어버리는\\n 작품의 흐름으로 보았을 때, 신의 진짜 의도는\\n 세상의 혼란 즉 악의라고 볼 수 밖에 없습니다. \\n  튼튼이가 살아남은 것과 박정자의 부활은 \\n무논리와 혼란을 더욱 강하게 만들려는 \\n신의 장난처럼 느껴기죠 \\n\\n\\n반대로, 고지가 아무런 법칙이 없다는 사실을 \\n다시한번 생각해본다면, 말그대로 그저 \\n우연일 수 있습니다 지금까진 고지를 받은\\n 당사자가 죽는것이 반복되어서 마치 인과성 ,\\n즉 원인과 결과 있는 법칙처럼 느껴지지만, \\n실제로는 괴물들은 아무나 사람 하나만 죽이면\\n 다시 돌아가게 설계되었다고 생각 할 수도 있습니다\\n 그래서 지옥에서 온 사자들은 튼튼이 부모를 \\n죽이자마자 곧바로 돌아간 것이죠 심지어, \\n고지 당시 천사의 대사를 들어보면, 애초에 죄에\\n 관한 언급은 나오지 않습니다. 그냥 지옥에 \\n간다고 이야기 할뿐이죠 어쩌면 인간은 누구나 \\n사망이후, 지옥에 가도록 세팅될 수도 있는겁니다. \\n다양한 가능성을 생각해보면, 부모의 희생이니\\n 숭고한 사랑이니 하는 것은 아무런 의미가 없는\\n 것입니다. 튼튼이가 살아남은 것은, 우연에 불과하죠.\\n  박정자 역시 별다른 이유없이 우연히 살아난것이고요\\n 다만 인간은 거대한 무의미를 참을 수 없어서, \\n상상력을 발휘해 의미의 빈틈을 메운것입니다\\n","imageId":"a08ff8dd-bf1b-43a7-0320-7df50ec05b00","original":{"source":"youtube","videoId":"PYpPLaNLRWQ","url":"https://www.youtube.com/watch?v=PYpPLaNLRWQ","isScrapping":true,"metadata":{"title":"《지옥》 이해하면 충격적인 결말 디테일 설정 총 정리!! (스포주의) - YouTube","description":"#지옥결말 #지옥디테일 #지옥해석안녕하세요 오늘은 넷프릭스에서 최근 공개된 드라마 지옥에 대한 리뷰입니다지옥은 다양한 방식으로 해석될 여지가 있는 드라마입니다저와 해석이 다른 분들은 리플로 남겨주세요!지옥은  넷플릭스에서 보실 수 있습니다문의 adclosetman@gmail.com","keywords":"동영상, 공유, 카메라폰, 동영상폰, 무료, 올리기","ogImage":"https://i.ytimg.com/vi/PYpPLaNLRWQ/hqdefault.jpg","ogTitle":"《지옥》 이해하면 충격적인 결말 디테일 설정 총 정리!! (스포주의)"}},"uid":1,
