      "id":"fold-1-20220611141825","type":"fold","uid":1,"label":"","title":"에드거앨런포의 추리소설/모르그가의 살인 사건/ASMR","description":"「모르그 가의 살인」은 추리소설의 효시라 불리는 작품으로\\n 범죄가 들끓는 대도시에 은둔해 사는 비범한 인물 \\n‘뒤팽’이 치밀한 추론과 심리 분석으로 \\n오리무중에 빠진 살인 사건을 해결해내는 이야기이다.\\n은둔형 천재 탐정 ‘뒤팽’과 평범한 지성의 화자 ‘나’로 구성된 이인 구성\\n상상력과 수학자의 논리로 사건을 해결하는 탐정과 \\n관행에 기댄 수사로 번번이 사건 해결에 실패하는 \\n경찰 집단의 대조는 훗날 아서 코넌 도일의 \\n‘셜록 홈스’에서 그대로 반복되며 현대 탐정소설의 공식이 되었다.\\n 밀실 범죄와 암호 해독, 탐정과 똑같은 비상한 사고 회로를 가진 숙적 \\n 현대 추리·범죄소설의 익숙한 장르 관습들이\\n 200여 년 전 포가 처음에 선보인 작품들 안에서\\n 이미 완벽하게 구현되어 있음을 볼 수 있다.\\n\\n\\n","imageId":"3324c314-7dc8-4d64-92f4-b0877828ad00","original":{"source":"youtube","videoId":"pVZjTbbyS-s","url":"https://www.youtube.com/watch?v=pVZjTbbyS-s","isScrapping":true,"metadata":{"title":"에드거앨런포의 추리소설/모르그가의 살인 사건/ASMR - YouTube","description":"안녕하세요. 오늘은 미국의 시인이자 소설가인 에드거 앨런포의 추리소설 [모르그가의 살인 사건]을 가지고 왔습니다.파리의 모르그가에서 일어난 살인사건을 해결하는 과정을 그린 이 작품은 탐정 캐릭터의 시초로 여겨지는 오귀스트 뒤팽이 처음으로 등장한 작품입니다.현대추리소설의 시초로 여겨...","keywords":"달세뇨, 여배우의책방, 오디오북, 소설, 여배우, 책방, 오디오, 밀리의서재, 서재, 협찬, 목소리, 잘때듣기좋은, 자기전에듣기좋은, 읽기좋은, 듣기좋은, asmr, audio book, audio, book, marcato mcn, 국내소설, 한국소설, 국외소설, 해외소설, 에드거앨런포, 모르그가의, 모르그가의살인사건, 살인사건, 살인","ogImage":"https://i.ytimg.com/vi/pVZjTbbyS-s/maxresdefault.jpg","ogTitle":"에드거앨런포의 추리소설/모르그가의 살인 사건/ASMR"}},"foldNode":{"title":"에드거앨런포의 추리소설/모르그가의 살인 사건/ASMR","description":"「모르그 가의 살인」은 추리소설의 효시라 불리는 작품으로\\n 범죄가 들끓는 대도시에 은둔해 사는 비범한 인물 \\n‘뒤팽’이 치밀한 추론과 심리 분석으로 \\n오리무중에 빠진 살인 사건을 해결해내는 이야기이다.\\n은둔형 천재 탐정 ‘뒤팽’과 평범한 지성의 화자 ‘나’로 구성된 이인 구성\\n상상력과 수학자의 논리로 사건을 해결하는 탐정과 \\n관행에 기댄 수사로 번번이 사건 해결에 실패하는 \\n경찰 집단의 대조는 훗날 아서 코넌 도일의 \\n‘셜록 홈스’에서 그대로 반복되며 현대 탐정소설의 공식이 되었다.\\n 밀실 범죄와 암호 해독, 탐정과 똑같은 비상한 사고 회로를 가진 숙적 \\n 현대 추리·범죄소설의 익숙한 장르 관습들이\\n 200여 년 전 포가 처음에 선보인 작품들 안에서\\n 이미 완벽하게 구현되어 있음을 볼 수 있다.\\n\\n\\n"},
