      "id":"fs-1-20220427195145","type":"fold","label":"","title":"20년전 고지를 받은 정진수의 삶 요약","description":"정진수는 엄마한테 버림받았습니다. \\n아주 어린 시절, 놀이동산에 놀러간 그날, \\n엄마는 핫도그 하나를 사주곤 멀리 떠나버렸죠. \\n혹시 내가 못된 아이라, 엄마가 나를 버린 것 아닐까? \\n내가 착한아이가 된다면, 엄마가 다시 돌아오지 않을까\\n? 꼬맹이 시절부터, 성인이되는 그날까지 그는\\n 누구보다 선하게 살았습니다 하지만, \\n엄마는 돌아오지 않았고, 오히려 19살 \\n그에게 다가온 것은 신의 고지였죠.  믿고 싶지 않았지만, \\n이것은 부정 할 수 없는 경험이었습니다. \\n그는 직감적으로 20년 후 2022년에 자신이 사망하게 \\n된다는 것을 알게되었죠. \\n어차피 죽어야 한다면, 굳이 더 살아야 할 이유가 있을까?\\n 그는 20살이되자마자 혼자 자살하기 위해 티베트로 갑니다\\n 그런데  운명의 장난인지, 그는 그곳에서 시연을 목격합니다\\n압도적인 괴물들의 힘으로 새카맣게 타버린 시체  \\n19년 후 그는 바로 이모습으로 죽을 예정이었죠 \\n정진수의 머리속은 공포로 가득찹니다. 피할 수 없는\\n 죽음이 오더라도, 적어도 이런방식은 아니었죠.\\n 혹시 고지가 잘못된 것 아닐까? 아니면 살수 있는\\n 방법이 있지 않을까? 그는 그 이후 모든 방법을 \\n사용해서, 고지를 받았던 케이스를 수집하고, \\n또 연구합니다. 그리고 2004년 미래종교의 발행인\\n 김정칠박사를 만나, 자신의 체험에 관한 인터뷰를 하게 되죠 \\n사실 이떄 까지 그는 아무런 해답을 얻지 못했습니다\\n 오히려 조사를 계속할수록 머리속은 더욱 복잡해져왔죠.\\n 물론 고지를 받은 사람중 악인도 있었습니다.\\n살인자도 그리고 조폭도 있었죠 \\n하지만, 아무리 뒷조사를 해봐도, 죽을만한 \\n죄가 없는 사람도 있었습니다. 마치 자신처럼요. \\n그런데, 죄인이 아닌사람도 결국은 고지받은\\n 날짜에 시연을 받았습니다.  이떄 정진수의 \\n머리속엔 의심이 생겼습니다. 시연 받은 사람들은\\n 죄를 잘 숨겼을 뿐이지, 죽을만한 악인이었을 것이다\\n. 나는 아직까지 커다란 죄를 저지르지 않았으니\\n, 살 수 있는 가능성이 있다.\\n\\n\\n그런데 신의 판단하는 죄란 무엇일까요? \\n어디까지가 죽을 죄 일까요? 물에 빠져 죽는 사람을 본다면, \\n그 사람을 구하지 않는 것이 죄가 될까요?  \\n정진수의 머릿속은 온통 공포로 가득차있었습니다.\\n 떄마침 적당한 사건도 생겼죠 그는 2008년\\n 화재현장에 뛰어들어 목슴을 걸고 사람을 구했습니다\\n 정진수가 대단한 정의감을 지닌 사람이여서가 아니라,\\n 죄를 저지르고 싶지 않았던 공포가 그를 행동하게 한것이죠. \\n그가 사람을 구한 것은 선일까? 어쩌면 그렇겠죠. \\n 이때 그는 깨달음을 얻게 됩니다. 아니 \\n어쩌면 공포에 미쳐버렸을지도 모르죠. \\n신이 고지를 내리는 이유를 알아버렸다고 생각했으니까요. \\n","imageId":"0da26089-6dab-445f-8493-52fe04be6b00","original":{"source":"youtube","videoId":"soZ8_g1KZG0","url":"https://www.youtube.com/watch?v=soZ8_g1KZG0","isScrapping":true,"metadata":{"title":"《 지옥 》 정진수 시점으로  20년을  돌아 보기  (스포주의) - YouTube","description":"#지옥결말 #정진수시점 #지옥해석안녕하세요 오늘은 넷플릭스에서 최근 공개된 정진수 캐릭터 분석입니다 선과악이 불분명한 입체적인 캐릭터분명 깜짝 놀라실 만한 내용이 들어있을 것이라 생각합니다 지옥은  넷플릭스에서 보실 수 있습니다문의 adclosetman@gmail.com","keywords":"동영상, 공유, 카메라폰, 동영상폰, 무료, 올리기","ogImage":"https://i.ytimg.com/vi/soZ8_g1KZG0/hqdefault.jpg","ogTitle":"《 지옥 》 정진수 시점으로  20년을  돌아 보기  (스포주의)"}},"uid":1,
