      "id":"fs-1-20220502180647","type":"fold","uid":1,"label":"","title":"[홀든 제주도여행 ]용두암-노잼의 바위 ","description":"용두암은 분출된 용암이 흐르고 난 뒤 남은 \\n용암수로가 파도에 의해 침식되면서 형성된 지형으로\\n말그대로 용의 머리를 닮았다는 용두암 \\n\\n 노잼 바위  \\n\\n 용두암 근처 해녀촌에서 먹은 \\n멍게, 소라는 맛은 있었지만 \\n평생 먹었던 멍게중에서 가장 비쌌음 \\n\\n절대 비추","imageId":"9eb5e5cf-7ad0-46b1-792a-e70d92431000","original":{"source":"youtube","videoId":"nwirQ_CgsZo","url":"https://youtu.be/nwirQ_CgsZo?t=95","isScrapping":true,"metadata":{"title":"용두암, 제주시 가볼만한곳 공항주변 명소 필수 여행지, Yongduam Rock - YouTube","description":"여행영상 : http://KoreaTraveler.co.kr","keywords":"제주도, 공항, 제주 공항, 제주, 제주도 공항, 공항주변, 필수, 제주도 필수, 제주도 여행지, 여행지, 용두암, Youngdo","ogImage":"https://i.ytimg.com/vi/nwirQ_CgsZo/hqdefault.jpg","ogTitle":"용두암, 제주시 가볼만한곳 공항주변 명소 필수 여행지, Yongduam Rock"}},
