      "id":"fs-4-20220507014640","type":"fold","uid":4,"label":"","title":"2004년 T1의 시작","description":"오리온은 개인 후원을 원했지만 \\n임요환은 E-sports가 자리잡기 위해서는 팀 창단, 팀 후원, \\n팀스폰 체제가 자리잡히고 '프로'의 이름으로 \\n리그가 진행되어야 한다는 것을 진작에 알고 있었다. \\n사비를 털어 팀을 운영했고 그렇게 스폰 없이 운영되던 팀이 4U였다. \\n\\n그리고 SKT가 4U를 스폰하며 팀을 창단했고 \\nSKT T1팀이 그렇게 탄생했다. \\n\\n그 이후에 KTF, CJ, 삼성칸 등 대기업 스폰 팀을 비롯해 \\nMBC게임, 온게임넷 등 방송사 후원의 팀과 화승, 웅진, 위메이드 등 \\n다양한 분야의 스폰서, 기업의 투자가 E-SPORT에 유입되기 시작 했다","imageId":"","original":{"source":"youtube","videoId":"l8H3s0DbWEw","url":"https://www.youtube.com/watch?v=l8H3s0DbWEw&t","isScrapping":true,"metadata":{"title":"2004년 T1의 시작 - YouTube","description":"우여곡절의 SKT T1 창단 이야기입니다자료 : OGN, SKT T1홈페이지","keywords":"#임요환, #T1, #SKT T1","ogImage":"https://i.ytimg.com/vi/l8H3s0DbWEw/maxresdefault.jpg","ogTitle":"2004년 T1의 시작"}},
