      "id":"fs-1-20220427195231","type":"fold","label":"","title":"형사 진경훈이 받아들이는 시연","description":"중세가 끝나고 근대가 오면서 인간은 신에게서 독립, \\n다시한번 자율성을 획득합니다 인본주의 이성주의 \\n 합리주의로 대표되는  근대는 신의 목소리를 버리고 \\n인간중심의 사고를 하게 됩니다. 신의 말씀이 지배하던\\n 중세와 다르게 근대는 인간이 만들어낸 법을 통해, 옳고 \\n그름을 판단하고. 또 그들을 처벌할 수 있는 권리가 생긴다고\\n 보고 있습니다. 법에서 정의하는 범죄는 선택의 여지가\\n 있을 때 처벌 할 수 있습니다. 그래서 진경훈이 그토록 \\n중요시하는 것은, 인간의 자유의지였던것이죠\\n 진경훈은, 5년전  부인을 잃었습니다. 그것도 살인마에게\\n 잔혹하게 죽임 당했죠.  하지만 이 살인마는, 심신미약을 \\n이유로  6년형을 받고 출소했습니다. 무고한 생명을 살해하고\\n 한가정을 완전히 붕괴시킨, 범죄에 단 6년형은 너무나 \\n가벼운 형벌이죠. 그 이후 진경훈의 딸 희정은 어딘가 고장나 \\n버렸습니다. 진성훈이 믿고 있는 인간의 법은, 너무나 \\n어처구니 없는 결과를 만들어낸 것입니다.\\n하지만 진경훈은 인간이성이 만들어낸 법에 순응합니다. \\n그래서 자신 가족을 파멸시킨 살인마에게 사적인 복수를 하지 않고,\\n  삶을 견디며 살아 가고있죠. 진경훈이 받아들이는 시연은, \\n 살인사건 그 이상도 이하도 아닙니다. \\n","imageId":"3d377b87-8e82-4a52-1e8a-253b65476c00","original":{"source":"youtube","videoId":"PYpPLaNLRWQ","url":"https://www.youtube.com/watch?v=PYpPLaNLRWQ","isScrapping":true,"metadata":{"title":"《지옥》 이해하면 충격적인 결말 디테일 설정 총 정리!! (스포주의) - YouTube","description":"#지옥결말 #지옥디테일 #지옥해석안녕하세요 오늘은 넷프릭스에서 최근 공개된 드라마 지옥에 대한 리뷰입니다지옥은 다양한 방식으로 해석될 여지가 있는 드라마입니다저와 해석이 다른 분들은 리플로 남겨주세요!지옥은  넷플릭스에서 보실 수 있습니다문의 adclosetman@gmail.com","keywords":"동영상, 공유, 카메라폰, 동영상폰, 무료, 올리기","ogImage":"https://i.ytimg.com/vi/PYpPLaNLRWQ/hqdefault.jpg","ogTitle":"《지옥》 이해하면 충격적인 결말 디테일 설정 총 정리!! (스포주의)"}},"uid":1,
