      "id":"fs-2-20220503120850","type":"fold","uid":2,"label":"","title":"염석대","description":"총장(지존)은 염보성이며, 이름의 유래는 염보성+염석대이다.\\n\\n기존의 즐타(즐겁게 스타하자)라는 분위기를 타파하고 성과지상주의 문화로의 전환을 선도한 대학이기도 하다. \\n\\n기존대학이 처음에는 사제 간의 소소한 소통과 개인 과외식 교육을 통해 일단 재미 위주로 방송을 이어가는 것이 집중하였다면,\\n 염석대는 기존의 틀을 깨고 성적을 우선순위로 하면서 프로리그에 준하는 몰입의 발단을 마련했다. \\n\\n이는 각 학교대전의 시청자 수를 폭발적으로 늘리는 계기를 마련했다. \\n일각에서는 점차 시들 수 있는 스타대학교 문화가 염석대 이후로 새로운 판도가 펼쳐지며 새로운 몰입 구도를 만들었다고 평가하며, 이러한 평가에 대해 딱히 부정하는 시각은 없는 것으로 보인다.","imageId":"bbb58b30-6301-48c1-1aaf-2b5b4e24fa00","original":{"source":"youtube","videoId":"qElWpG4xYzw","url":"https://youtu.be/qElWpG4xYzw?t=215","isScrapping":true,"metadata":{"title":"스타 대학교만 11개?? 누가누군데??  한번 요약해보자 ~ 1월11일기준 - YouTube","description":"#아프리카tv #스타대학교 #철기중대각종 사진 출처나무위키 / 아프리카tv 방송국/ 와이고수/ 에펨코리아를 참고하였습니다브금1 - https://www.youtube.com/watch?v=mD4GbGmvNRc&list=PLi5j3dFdGW7uNb-Q2XWwsHpAzYGqvTDOw브...","keywords":"철기중대, 바스포드, 학버드, 캄성여대, NSU, 염석대, 친박연대, 미다스공대, 마종대, 우끼끼즈, 파이스트","ogImage":"https://i.ytimg.com/vi/qElWpG4xYzw/hqdefault.jpg","ogTitle":"스타 대학교만 11개?? 누가누군데??  한번 요약해보자 ~ 1월11일기준"}},
