      "id":"fold-1-20220611191826","type":"fold","uid":1,"label":"","title":"살인의 동기란 무엇인가? 히가시노 게이고 악의 ","description":"유명 베스트 셀러 작가인 히다카 구니히코가 살해된 채 발견된다. 발견자는 그의 아내 히다카 리에와 그의 친구인 노노구치 오사무. 상황을 보면 소설 원고를 쓰던 도중 누군가에게 공격당해 살해된 것으로 보인다.\\n\\n노노구치 오사무는 히다카 구니히코와는 어린 시절부터 알고 지낸 친구이다. 그리고 가가 형사가 교사로 근무하던 시절 같은 학교에서 교편을 잡고 있던 국어 선생이기도 하다. 교사를 그만 둔 후에는 아동문학 작가로 활동하고 있다. 히다카의 전화를 받고 그의 집에서 만나기로 했는데 집에 찾아가 보니 이미 살해되어 있었던 것. 그는 작가답게 이 모든 것을 소설을 쓰듯 기록으로 남겨둔다.\\n\\n이 사건을 수사하게 된 가가 교이치로는 옛 교사 선배인 노노구치와 재회하며 그가 쓴 수기를 토대로 범인을 추리해 간다. 그 과정에서의 놀라운 사실들이 계속해서 밝혀진다.\\n\\n일반적인 추리 소설과 달리 범인이 누구인지는 소설이 1/3도 채 진행되지 않았을 때 밝혀지며 범인도 순순히 자신의 범행이었음을 인정한다. 이렇게 싱겁게 끝나는가 하겠지만 그때부터가 진짜 이야기의 시작이라고 할 수 있다.","imageId":"9eb49f2a-7680-477e-6f15-5769ad7dc900","original":{"source":"youtube","videoId":"O8JytxzR2qc","url":"https://www.youtube.com/watch?v=O8JytxzR2qc","isScrapping":true,"metadata":{"title":"[소비의 형태] 살인의 동기란 무엇일까? 를 생각하며 썼다는 일본 추리소설의 대가 히가시노 게이고의 ‘악의’ - YouTube","description":"일본 추리소설의 대가 히가시노 게이고의 소설. 정말 오랫만에 책이 읽고 싶어서 구입하게 되었습니다. 영화화 된 작품들이 많은 만큼 몰입도가 좋아서 잘 읽고 있습니다.","keywords":"악의, 히가시노게이고, 추리소설, 장편소설, 일본작가, 일본소설, 책읽는남자, 인간실격, 다자이오사무","ogImage":"https://i.ytimg.com/vi/O8JytxzR2qc/maxresdefault.jpg","ogTitle":"[소비의 형태] 살인의 동기란 무엇일까? 를 생각하며 썼다는 일본 추리소설의 대가 히가시노 게이고의 ‘악의’"}},"foldNode":{"title":"살인의 동기란 무엇인가? 히가시노 게이고 악의 ","description":"유명 베스트 셀러 작가인 히다카 구니히코가 살해된 채 발견된다. 발견자는 그의 아내 히다카 리에와 그의 친구인 노노구치 오사무. 상황을 보면 소설 원고를 쓰던 도중 누군가에게 공격당해 살해된 것으로 보인다.\\n\\n노노구치 오사무는 히다카 구니히코와는 어린 시절부터 알고 지낸 친구이다. 그리고 가가 형사가 교사로 근무하던 시절 같은 학교에서 교편을 잡고 있던 국어 선생이기도 하다. 교사를 그만 둔 후에는 아동문학 작가로 활동하고 있다. 히다카의 전화를 받고 그의 집에서 만나기로 했는데 집에 찾아가 보니 이미 살해되어 있었던 것. 그는 작가답게 이 모든 것을 소설을 쓰듯 기록으로 남겨둔다.\\n\\n이 사건을 수사하게 된 가가 교이치로는 옛 교사 선배인 노노구치와 재회하며 그가 쓴 수기를 토대로 범인을 추리해 간다. 그 과정에서의 놀라운 사실들이 계속해서 밝혀진다.\\n\\n일반적인 추리 소설과 달리 범인이 누구인지는 소설이 1/3도 채 진행되지 않았을 때 밝혀지며 범인도 순순히 자신의 범행이었음을 인정한다. 이렇게 싱겁게 끝나는가 하겠지만 그때부터가 진짜 이야기의 시작이라고 할 수 있다."},
