      "id":"fs-2-20220503122817","type":"fold","uid":2,"label":"","title":"철기중대","description":"철구, 기뉴다, 김윤중의 주도 하에 설립되었다.\\n\\n대학교의 어원은 철구의 철, 기뉴다의 기, 김윤중의 중을 합친 이름이다. 이름 순서가 곧 서열이기도 하고, 맨 마지막 김윤중 탓에 군대의 편제 중대를 떠올리게 만드는 이름이기도 하다.\\n\\n후발 주자였음에도 불구하고 철구, 기뉴다, 김윤중의 팬들로 인해 순조롭게 출발하였다. \\n심지어 서든 국대 출신 BJ 킴성태까지 철기중대에 창단 멤버로 합류하여 기존에 스타대학들이 스승과 제자 및 가족 같은 분위기였다면 철기중대는 후발 주자임에도 보라와 스타를 모두 살리겠다는 컨셉으로 시청자들의 주목을 받기 시작했다. 훈련을 시키는 지옥주와 컨텐츠 중심의 보라주로 나누어 운영할 계획이었다. \\n후술하겠지만 철구 감성이 깃든 벌삭비(벌레먹기, 삭발, 비키니 입기), 기뉴다의 기플릭스도 시청자의 이목을 끄는 요소기도 했다.\\n\\n이후 처음 진행한 대학대전에서 비록 대떡을 당해 패배하였지만 벌삭비로 인해 후발주자임에도 성공적으로 주목받게 되면서 스타대학판에 크게 자리를 잡게 되었다\\n","imageId":"360b3223-f24d-467d-ebfc-aed592ba6300","original":{"source":"youtube","videoId":"qElWpG4xYzw","url":"https://youtu.be/qElWpG4xYzw?t=253","isScrapping":true,"metadata":{"title":"스타 대학교만 11개?? 누가누군데??  한번 요약해보자 ~ 1월11일기준 - YouTube","description":"#아프리카tv #스타대학교 #철기중대각종 사진 출처나무위키 / 아프리카tv 방송국/ 와이고수/ 에펨코리아를 참고하였습니다브금1 - https://www.youtube.com/watch?v=mD4GbGmvNRc&list=PLi5j3dFdGW7uNb-Q2XWwsHpAzYGqvTDOw브...","keywords":"철기중대, 바스포드, 학버드, 캄성여대, NSU, 염석대, 친박연대, 미다스공대, 마종대, 우끼끼즈, 파이스트","ogImage":"https://i.ytimg.com/vi/qElWpG4xYzw/hqdefault.jpg","ogTitle":"스타 대학교만 11개?? 누가누군데??  한번 요약해보자 ~ 1월11일기준"}},
