      "id":"fs-2-20220503120848","type":"fold","uid":2,"label":"","title":"캄성여대","description":"총장은 김윤환과 김성대이다.\\n\\n원래는 각각 김성여대(총장 김성대), 캄브릿지(총장 김윤환)인 대학으로 별개의 대학이였으나, 합병되어 캄성여대로 재탄생 이후 함께 운영중이다.\\n\\n다른 스타대학와 달리 자유분방하며 순한 맛 컨텐츠가 특징이며, 카트대학이라고도 불린다. (카트를 굉장히 많이하며 진심이다. \\n이 때문에 억타(억지스타)라는 프레임이 있었으며, 염보성이 억타대학이라고 공개적으로 깠다.) \\n\\n타 대학과는 달리 소속감이 굉장히 높은편이며, 학생들 이적에 대해 총장들은 이적을 원한다면 존중 하겠다고 하였지만 현재 자퇴 0, 퇴학 0으로 아프리카 스타 대학에선 유일무이하다.","imageId":"db004548-b9df-4a40-d791-e7c661633a00","original":{"source":"youtube","videoId":"qElWpG4xYzw","url":"https://youtu.be/qElWpG4xYzw?t=159","isScrapping":true,"metadata":{"title":"스타 대학교만 11개?? 누가누군데??  한번 요약해보자 ~ 1월11일기준 - YouTube","description":"#아프리카tv #스타대학교 #철기중대각종 사진 출처나무위키 / 아프리카tv 방송국/ 와이고수/ 에펨코리아를 참고하였습니다브금1 - https://www.youtube.com/watch?v=mD4GbGmvNRc&list=PLi5j3dFdGW7uNb-Q2XWwsHpAzYGqvTDOw브...","keywords":"철기중대, 바스포드, 학버드, 캄성여대, NSU, 염석대, 친박연대, 미다스공대, 마종대, 우끼끼즈, 파이스트","ogImage":"https://i.ytimg.com/vi/qElWpG4xYzw/hqdefault.jpg","ogTitle":"스타 대학교만 11개?? 누가누군데??  한번 요약해보자 ~ 1월11일기준"}},
