      "id":"fs-1-20220501160433","type":"fold","label":"","title":"스테이크의 왕 등심 ","description":"맛이 진하고 구워 먹어도 충분히 부드럽기 때문에, 채끝살, \\n안심과 더불어 쇠고기 3대장에 속한다. \\n특히 곡물을 다량으로 먹인 곡물비육우는 이 등심\\n의 결마다 지방질이 형성되어 열을 가하면 지방이 녹아나오면서 \\n비단결처럼 부드러운 식감과 풍성한 맛을 선사한다.\\n\\n한국에서는 지방층이 고르게 분포되어 있는 것을 좋아하고 그것을\\n 마블링이라고 칭하며 이 마블링이 고기의 품질과 \\n가격에 큰 영향력을 끼친다. 서구권 식문화를 살펴보면 \\n한국과 달리 지방층이 거의 없이 살코기 위주로 가공된 \\n등심을 주로 취급하지만 어디까지나 주로 취급하는 것일 뿐\\n 서양권에서도 마블링 자잘하게 빽빽한 컷을 더 선호한다. \\n근육 내 쇠고기 지방은 미디움 레어 온도에서도 충분히 \\n익으며 바싹 익힌 고기는 기름기가 쭉 빠져나가 기름의\\n 풍미가 오히려 부족해진다. 웰던 스테이크를 굽는 \\n이유는 표면의 크러스트를 극대화해 마이야르 반응을 통\\n한 풍미를 얻는 것이지 기름을 녹이기 위해서가 아니다\\n\\n\\n영상내에 새우살이 클 수록 중앙에 가깝고, \\n아랫등심으로 내려갈 수록 채끝에 가깝다 \\n\\n\\n\\n\\n","imageId":"f7b2c5c7-0137-4019-6875-abdc7c321b00","original":{"source":"youtube","videoId":"1DsqrgdSmjQ","url":"https://youtu.be/1DsqrgdSmjQ","isScrapping":true,"metadata":{"title":"최고의 등심을 고르는 법 (feat.해부학) - YouTube","description":"소고기는 정말 맛있습니다.하지만 같은 가격의 등심이라도 그 차이가 존재하죠.오늘은 최고의 등심을 고르는 방법을 알아보겠습니다.작중 참고자료는 이해를 돕기위한 내용으로실제 연대기와 다소 불일치할 수 있으며자료과 사건은 직접적인 연관이 없을수도 있습니다.다소 의역이 있습니다.#소고기 ...","keywords":"한우, 등심, 척아이롤, 소고기, 지식채널e, 스테이크, 코스트코","ogImage":"https://i.ytimg.com/vi/1DsqrgdSmjQ/maxresdefault.jpg","ogTitle":"최고의 등심을 고르는 법 (feat.해부학)"}},"uid":1,
