      "id":"fold-1-20220620193759","type":"fold","uid":1,"label":"","title":"[MBTI]ISTJ 잇티제의 성격 분석 ","description":"청렴결백한 논리주의자, 세상의 소금형\\n\\n실제 사실에 대하여 정확하고 체계적으로 기억하며 일 처리에 있어서도 신중하고 책임감이 있다. 집중력이 강한 현실 감각을 지녔으며 조직적이고 침착하다. 보수적인 경향이 있으며, 문제를 해결하는데 과거의 경험을 잘 적용하며, 반복되는 일상적인 일에 대한 인내력이 강하다. 3차기능인 Fi(내향 감정)로 인해 자신과 타인의 감정과 기분을 이해하는 능력이 부족하며, 4차기능이 Ne(외향 직관)로 나무보다 숲을 보는 직관 능력이 매우 부족하여 전체적이고 타협적 방안을 고려하는 노력이 필요하다. 정확성과 조직력을 발휘하는 분야의 일을 선호한다.\\n\\n다소 내향적이지만 틀에 짜여진 사회에서 주어진 임무를 철저하게 완수하려 노력하며 규칙을 잘 준수하는 유형이라 회사나 공공기관 근무를 선호하고 일반적인 학교 선생님들이 매우 좋아하는 유형이다. 겉으로 튀는 것을 별로 안 좋아하고 용의단정하며 정돈된 스타일이다.","imageId":"4fcc68fd-5bab-416c-27b8-f9772e9fcd00","original":{"source":"youtube","videoId":"lgHxM6iTQZc","url":"https://youtu.be/lgHxM6iTQZc?t=35","isScrapping":true,"metadata":{"title":"ISTJ (잇티제)가 손절하는 이유 - YouTube","description":"MBTI 16가지 유형 중 가장 신뢰할 수 있는 유형인 ISTJ 유형에 대해서 설명합니다. #ISTJ#잇티제#MBTIhttps://www.freepik.com/photos/man Man photo created by master1305 - www.freepik.com https:/...","keywords":"MBTI, ISTP, INTP, ESTP, ENTP, ISFP, INFP, ESFP, ENFP, ISTJ, INTJ, ESTJ, ENTJ, ISFJ, INFJ, ESFJ, ENFJ, 칼 융, 심리유형, 성격유형, 손절","ogImage":"https://i.ytimg.com/vi/lgHxM6iTQZc/maxresdefault.jpg","ogTitle":"ISTJ (잇티제)가 손절하는 이유"},"isControls":true},"foldNode":{"title":"[MBTI]ISTJ 잇티제의 성격 분석 ","description":"청렴결백한 논리주의자, 세상의 소금형\\n\\n실제 사실에 대하여 정확하고 체계적으로 기억하며 일 처리에 있어서도 신중하고 책임감이 있다. 집중력이 강한 현실 감각을 지녔으며 조직적이고 침착하다. 보수적인 경향이 있으며, 문제를 해결하는데 과거의 경험을 잘 적용하며, 반복되는 일상적인 일에 대한 인내력이 강하다. 3차기능인 Fi(내향 감정)로 인해 자신과 타인의 감정과 기분을 이해하는 능력이 부족하며, 4차기능이 Ne(외향 직관)로 나무보다 숲을 보는 직관 능력이 매우 부족하여 전체적이고 타협적 방안을 고려하는 노력이 필요하다. 정확성과 조직력을 발휘하는 분야의 일을 선호한다.\\n\\n다소 내향적이지만 틀에 짜여진 사회에서 주어진 임무를 철저하게 완수하려 노력하며 규칙을 잘 준수하는 유형이라 회사나 공공기관 근무를 선호하고 일반적인 학교 선생님들이 매우 좋아하는 유형이다. 겉으로 튀는 것을 별로 안 좋아하고 용의단정하며 정돈된 스타일이다."},
