      "id":"fold-8-20220622122829","type":"fold","uid":8,"label":"","title":"[군대] 임병장 사건","description":"김일병 사건에 이어 14년도 임병장 사건이 터졌다.\\n\\n2014년 6월 21일 오후 8시 15분 경 강원도 고성군에 위치한 대한민국 육군 제22보병사단 제55연대 GOP에서 발생한 군무이탈 및 총기난사 사건. \\n가해자인 임도빈 병장의 이름에서 따와 일명 임 병장 사건으로 널리 알려진 사건이다. 지금까지 비슷한 류의 총기난사 사건은 많이 발생하였으나, \\n이 사건이 유독 화제가 된 이유는 피의자가 전역이 불과 3개월밖에 남지 않은 병장이었기 때문이며, 병장이 벌인 총기난사 사건은 거의 없다시피했기 때문이다.\\n","imageId":"ca6af9b4-b478-46e5-768a-e886ab425f00","original":{"source":"youtube","videoId":"X288GM4FNXk","url":"https://youtu.be/X288GM4FNXk","isScrapping":true,"metadata":{"title":"軍, '총기난사' 임 병장 조준사격 화면 공개 / YTN - YouTube","description":"[YTN 기사원문] http://www.ytn.co.kr/_ln/0101_201407151700514140[앵커]육군 동부전선 GOP총기난사 사건은 동료병사의 무시에 화가난 임 모 병장이 계획적으로 저지른 범죄로 결론났습니다.군 수사팀은 총기난사때 조준사격 자세를 취하던 CCTV ...","keywords":"YTN, 뉴스, 정치","ogImage":"https://i.ytimg.com/vi/X288GM4FNXk/hqdefault.jpg","ogTitle":"軍, '총기난사' 임 병장 조준사격 화면 공개 / YTN"},"isControls":true},"foldNode":{"title":"[군대] 임병장 사건","description":"김일병 사건에 이어 14년도 임병장 사건이 터졌다.\\n\\n2014년 6월 21일 오후 8시 15분 경 강원도 고성군에 위치한 대한민국 육군 제22보병사단 제55연대 GOP에서 발생한 군무이탈 및 총기난사 사건. \\n가해자인 임도빈 병장의 이름에서 따와 일명 임 병장 사건으로 널리 알려진 사건이다. 지금까지 비슷한 류의 총기난사 사건은 많이 발생하였으나, \\n이 사건이 유독 화제가 된 이유는 피의자가 전역이 불과 3개월밖에 남지 않은 병장이었기 때문이며, 병장이 벌인 총기난사 사건은 거의 없다시피했기 때문이다.\\n"},
