      "id":"fold-1-20220621140726","type":"fold","uid":1,"label":"","title":"[MBTI] ESTJ 엣티제 성격분석 ","description":"엄격한 관리자, 사업가형\\n\\n현실적, 구체적, 사실적이며 어떠한 활동을 조직화하고 주도해 나가는 지도력이 있다. 실질적이고 현실 감각이 뛰어나며 일을 조직하고 계획하여 추진시키는 능력이 있다. 행정, 의료, 법조, 군경, 재정, 특히나 모든 것을 망라한 한 단어로 '조직관리' 분야에 뛰어난 재능을 지녔으며, 체계적으로 사업체나 조직체를 이끌어 나간다. 타고난 지도자로서 프로젝트의 목표를 설정하고, 지시하고, 결정하고, 독려하여 기한 내에 철저히 이행하는 능력이 있다. 불확실한 미래의 가능성보다 흔들리지 않는 현재의 사실을 추구하기 때문에 현실중심적, 실용적인 면이 강하다. 하지만 타인과 자신의 감정을 고려하는 능력이 부족하여 속단속결하는 경향과 업무 위주로 딱딱하게 사람을 대하는 경향이 있으므로 인간 중심의 가치에 대해 고민하고 타인의 감정을 충분히 고려해야 한다.\\n\\n타인의 단점들을 디테일하게 지적하고 즉각 수정하기를 요구하며 화를 내는 성격이 전형적인 불건강한 ESTJ 유형이다. 건강한 유형이라면 상대방의 디테일한 단점들을 보고 속에서 끓어 오르는 열을 입밖으로 그대로 토해내지 않는다. 건강한 유형은 타인에 대한 지적을 자제하고, 타인의 성격과 능력치를 상식적, 논리적으로 고려하여 업무를 배분한다","imageId":"2947e839-88e7-4a76-ff80-5a8d54fe9f00","original":{"source":"youtube","videoId":"M6KYkAkxOO4","url":"https://youtu.be/M6KYkAkxOO4?t=206","isScrapping":true,"metadata":{"title":"ESTJ (엣티제)가 잔소리하는 이유 - YouTube","description":"MBTI 16가지 유형 중 가장 현실적인 유형인 ESTJ 유형에 대해서 설명합니다. #ESTJ#엣티제#MBTIhttps://www.freepik.com/photos/peoplePeople photo created by jcomp - www.freepik.comhttps://www....","keywords":"MBTI, ISTP, INTP, ESTP, ENTP, ISFP, INFP, ESFP, ENFP, ISTJ, INTJ, ESTJ, ENTJ, ISFJ, INFJ, ESFJ, ENFJ, 칼 융, 심리유형, 성격유형, 엣티제","ogImage":"https://i.ytimg.com/vi/M6KYkAkxOO4/hqdefault.jpg","ogTitle":"ESTJ (엣티제)가 잔소리하는 이유"},"isControls":true},"foldNode":{"description":"엄격한 관리자, 사업가형\\n\\n현실적, 구체적, 사실적이며 어떠한 활동을 조직화하고 주도해 나가는 지도력이 있다. 실질적이고 현실 감각이 뛰어나며 일을 조직하고 계획하여 추진시키는 능력이 있다. 행정, 의료, 법조, 군경, 재정, 특히나 모든 것을 망라한 한 단어로 '조직관리' 분야에 뛰어난 재능을 지녔으며, 체계적으로 사업체나 조직체를 이끌어 나간다. 타고난 지도자로서 프로젝트의 목표를 설정하고, 지시하고, 결정하고, 독려하여 기한 내에 철저히 이행하는 능력이 있다. 불확실한 미래의 가능성보다 흔들리지 않는 현재의 사실을 추구하기 때문에 현실중심적, 실용적인 면이 강하다. 하지만 타인과 자신의 감정을 고려하는 능력이 부족하여 속단속결하는 경향과 업무 위주로 딱딱하게 사람을 대하는 경향이 있으므로 인간 중심의 가치에 대해 고민하고 타인의 감정을 충분히 고려해야 한다.\\n\\n타인의 단점들을 디테일하게 지적하고 즉각 수정하기를 요구하며 화를 내는 성격이 전형적인 불건강한 ESTJ 유형이다. 건강한 유형이라면 상대방의 디테일한 단점들을 보고 속에서 끓어 오르는 열을 입밖으로 그대로 토해내지 않는다. 건강한 유형은 타인에 대한 지적을 자제하고, 타인의 성격과 능력치를 상식적, 논리적으로 고려하여 업무를 배분한다","title":"[MBTI] ESTJ 엣티제 성격분석 "},
