      "id":"fold-1-20220621125026","type":"fold","uid":1,"label":"","title":"[MBTI]INTP 인팁 성격 분석","description":"조용하고 과묵하며 논리와 분석으로 문제를 해결하기 좋아한다. 먼저 대화를 시작하지 않는 편이나 관심이 있는 분야에 대해서는 말을 많이 한다. 이해가 빠르고 직관력으로 통찰하는 능력이 있으며 지적 호기심이 많아, 분석적이고 논리적이다. MBTI 16가지 성격 유형 중 창의적 지능과 논리면에서 가장 뛰어나, 비과학적이거나 논리적이지 못한 일들에 대단히 거부반응을 보일 경향이 높다. 특히 종교. 아이디어와 원리, 인과관계에 관심이 많으며 실체보다는 실체가 품고 있는 가능성에 관심이 많다. 다시 말해 지식을 아는 것과 별개로, 그에 대한 감각이나 능률적 활용은 더딘 편.\\n\\n보조기능(Ne)이 과잉일 경우 매우 추상적이고 비현실적으로 생각하는 경향이 있다. 복잡한 문제를 해결하고 답을 찾는데 집중력을 발휘하지만 막상 그 해결책을 실제 현실에 적용하는 것에는 관심이 없다.[7]","imageId":"c095dfc8-8c2c-4cff-60e9-63bfe1c1ed00","original":{"source":"youtube","videoId":"TbdVLG50Qo0","url":"https://youtu.be/TbdVLG50Qo0?t=45","isScrapping":true,"metadata":{"title":"INTP (인팁), 잠수타는 이유 - YouTube","description":"MBTI 16가지 유형 중 가장 지적인 유형인 INTP (인팁) 유형에 대해서 설명합니다. #INTP#인팁#MBTI00:00 인트로00:33 NT그룹에 대하여04:29 INTP와 비슷한 유형들06:26 INTP가 괴짜인 이유07:05 INTP가 잠수타는 이유https://www.f...","keywords":"MBTI, ISTP, INTP, ESTP, ENTP, ISFP, INFP, ESFP, ENFP, ISTJ, INTJ, ESTJ, ENTJ, ISFJ, INFJ, ESFJ, ENFJ, 칼 융, 심리유형, 성격유형, 인팁","ogImage":"https://i.ytimg.com/vi/TbdVLG50Qo0/maxresdefault.jpg","ogTitle":"INTP (인팁), 잠수타는 이유"},"isControls":true},"foldNode":{"title":"[MBTI]INTP 인팁 성격 분석","description":"조용하고 과묵하며 논리와 분석으로 문제를 해결하기 좋아한다. 먼저 대화를 시작하지 않는 편이나 관심이 있는 분야에 대해서는 말을 많이 한다. 이해가 빠르고 직관력으로 통찰하는 능력이 있으며 지적 호기심이 많아, 분석적이고 논리적이다. MBTI 16가지 성격 유형 중 창의적 지능과 논리면에서 가장 뛰어나, 비과학적이거나 논리적이지 못한 일들에 대단히 거부반응을 보일 경향이 높다. 특히 종교. 아이디어와 원리, 인과관계에 관심이 많으며 실체보다는 실체가 품고 있는 가능성에 관심이 많다. 다시 말해 지식을 아는 것과 별개로, 그에 대한 감각이나 능률적 활용은 더딘 편.\\n\\n보조기능(Ne)이 과잉일 경우 매우 추상적이고 비현실적으로 생각하는 경향이 있다. 복잡한 문제를 해결하고 답을 찾는데 집중력을 발휘하지만 막상 그 해결책을 실제 현실에 적용하는 것에는 관심이 없다.[7]"},
