      "id":"fold-1-20220620204649","type":"fold","uid":1,"label":"","title":"[MBTI]ISFJ 성격분석","description":"용감감한 수호자, 실용적인 조력가\\n\\nISFJ 유형 성격의 소유자는 조용하고 차분하며 따뜻하고 친근하다. 책임감과 인내력 또한 매우 강하다. 본인의 친한 친구나 가족에게 애정이 가득하다. 이들은 언제나 진솔하려 노력하고 가볍지 않기 때문에 관계를 맺기에 가장 어려우나 가장 믿음직스러운 유형이다.\\n\\n사회생활 시 외부 환경에 대해 내향형 중에서 가장 방어력이 강하다. 상대방의 감정을 파악하는 데는 능숙하지만 표현하는 데는 서툴기 때문에 관계에 있어서 걱정을 하는 경우가 많다. 실제적이고 꼼꼼하게 계획적이며 협조적으로 일을 처리한다. 완벽한 결과물을 도출하지 못할 경우 스트레스를 상당히 받으며, 이상과 달리 귀차니즘이 생겼을 시, 자신에게서도 극심한 괴리감을 느낀다.경험을 통해서 자신이 틀렸다고 인정할 때까지 꾸준히 밀고 나가는 편이다.\\n\\n대한민국에서는 MBTI 유형 중 ISTJ, ESTJ 다음으로 흔한 편이며 정의내리기 어려운 유형이다. 부드럽고 다정한 성격을 가지고 있지만 대상에 따라 단호하고 차가울 때도 있기 때문에 감정이 쉽게 탄로나기도 한다.","imageId":"4a68a4f9-1250-40da-5d44-95a4b5c73100","original":{"source":"youtube","videoId":"CbXINuJkqcw","url":"https://youtu.be/CbXINuJkqcw?t=90","isScrapping":true,"metadata":{"title":"ISFJ (잇프제)가 멀어지는 이유 (eng) - YouTube","description":"MBTI 16가지 유형 중 가장 믿음이 가는 유형인 ISFJ (잇프제) 유형에 대해서 설명합니다. (그림 instagram twitter @_lamang)#ISFJ#잇프제#MBTI00:00 인트로00:52 ISFJ는 중간형?02:15 ISFJ는 착하다?05:18 ISFJ의 머리가 ...","keywords":"MBTI, ISTP, INTP, ESTP, ENTP, ISFP, INFP, ESFP, ENFP, ISTJ, INTJ, ESTJ, ENTJ, ISFJ, INFJ, ESFJ, ENFJ, 칼 융, 심리유형, 성격유형, 잇프제","ogImage":"https://i.ytimg.com/vi/CbXINuJkqcw/maxresdefault.jpg","ogTitle":"ISFJ (잇프제)가 멀어지는 이유 (eng)"},"isControls":true},"foldNode":{"title":"[MBTI]ISFJ 성격분석","description":"용감감한 수호자, 실용적인 조력가\\n\\nISFJ 유형 성격의 소유자는 조용하고 차분하며 따뜻하고 친근하다. 책임감과 인내력 또한 매우 강하다. 본인의 친한 친구나 가족에게 애정이 가득하다. 이들은 언제나 진솔하려 노력하고 가볍지 않기 때문에 관계를 맺기에 가장 어려우나 가장 믿음직스러운 유형이다.\\n\\n사회생활 시 외부 환경에 대해 내향형 중에서 가장 방어력이 강하다. 상대방의 감정을 파악하는 데는 능숙하지만 표현하는 데는 서툴기 때문에 관계에 있어서 걱정을 하는 경우가 많다. 실제적이고 꼼꼼하게 계획적이며 협조적으로 일을 처리한다. 완벽한 결과물을 도출하지 못할 경우 스트레스를 상당히 받으며, 이상과 달리 귀차니즘이 생겼을 시, 자신에게서도 극심한 괴리감을 느낀다.경험을 통해서 자신이 틀렸다고 인정할 때까지 꾸준히 밀고 나가는 편이다.\\n\\n대한민국에서는 MBTI 유형 중 ISTJ, ESTJ 다음으로 흔한 편이며 정의내리기 어려운 유형이다. 부드럽고 다정한 성격을 가지고 있지만 대상에 따라 단호하고 차가울 때도 있기 때문에 감정이 쉽게 탄로나기도 한다."},
