      "id":"fold-1-20220621130447","type":"fold","uid":1,"label":"","title":"[MBTI] INFJ 인프제 성격 분석","description":"전 세계의 1.5%미만을 차지하는 극 소수의 유형. 인내심이 많고 통찰력과 직관력이 매우 뛰어나며 화합을 추구한다. 창의력이 좋으며, 성숙한 경우엔 강한 직관력으로 타인에게 말없이 영향력을 끼친다. 독창성과 내적 독립심이 강하며, 확고한 신념과 열정으로 자신의 영감을 구현시켜 나가는 정신적 지도자들이 많다. 나무보다 숲을 본다. 한곳에 몰두하는 경향으로 목적 달성에 필요한 주변적인 조건들을 경시하기 쉽고, 자기 내부의 갈등이 많고 복잡하다. 이들은 풍부하고 감성적인 내적인 성격을 갖고 있다.\\n\\nINTJ, INTP, INFP처럼 내향적인 이상주의자 성향을 가지고 있다. 따라서 일반적으로 현실적인 장소에서는 말이 없어 보이기도 한다. 친한 친구나 지인 앞에서 미래에 대한 각종 예측과 상상에 대한 말을 하기 좋아하는 특성이 있다. 공상이 꼬리에 꼬리를 물고 테두리 밖으로 잘 벗어나는 INFP와는 달리, 합리적인 테두리 안에서 공상과 발상을 하는 성격인 만큼 이들의 예측은 제법 논리가 잡혀 있어 맞는 편이다.","imageId":"7cfea521-4ddf-4229-eedb-2c791c17c800","original":{"source":"youtube","videoId":"5nUDCutJbpM","url":"https://youtu.be/5nUDCutJbpM?t=169","isScrapping":true,"metadata":{"title":"INFJ (인프제)가 외로운 이유 (eng) - YouTube","description":"MBTI 16가지 유형 중 가장 복잡하고 심오한 유형인 INFJ (인프제) 유형에 대해서 설명합니다. (그림 instagram twitter @_lamang)#INFJ#인프제#MBTI00:00 인트로00:37 INFJ가 복잡한 이유03:17 INFJ가 외로운 이유06:12 예수와 ...","keywords":"MBTI, ISTP, INTP, ESTP, ENTP, ISFP, INFP, ESFP, ENFP, ISTJ, INTJ, ESTJ, ENTJ, ISFJ, INFJ, ESFJ, ENFJ, 칼 융, 심리유형, 성격유형, 인프제","ogImage":"https://i.ytimg.com/vi/5nUDCutJbpM/maxresdefault.jpg","ogTitle":"INFJ (인프제)가 외로운 이유 (eng)"},"isControls":true},"foldNode":{"title":"[MBTI] INFJ 인프제 성격 분석","description":"전 세계의 1.5%미만을 차지하는 극 소수의 유형. 인내심이 많고 통찰력과 직관력이 매우 뛰어나며 화합을 추구한다. 창의력이 좋으며, 성숙한 경우엔 강한 직관력으로 타인에게 말없이 영향력을 끼친다. 독창성과 내적 독립심이 강하며, 확고한 신념과 열정으로 자신의 영감을 구현시켜 나가는 정신적 지도자들이 많다. 나무보다 숲을 본다. 한곳에 몰두하는 경향으로 목적 달성에 필요한 주변적인 조건들을 경시하기 쉽고, 자기 내부의 갈등이 많고 복잡하다. 이들은 풍부하고 감성적인 내적인 성격을 갖고 있다.\\n\\nINTJ, INTP, INFP처럼 내향적인 이상주의자 성향을 가지고 있다. 따라서 일반적으로 현실적인 장소에서는 말이 없어 보이기도 한다. 친한 친구나 지인 앞에서 미래에 대한 각종 예측과 상상에 대한 말을 하기 좋아하는 특성이 있다. 공상이 꼬리에 꼬리를 물고 테두리 밖으로 잘 벗어나는 INFP와는 달리, 합리적인 테두리 안에서 공상과 발상을 하는 성격인 만큼 이들의 예측은 제법 논리가 잡혀 있어 맞는 편이다."},
