      "id":"fold-1-20220621172437","type":"fold","uid":1,"label":"","title":"[MBTI] ESFJ 엣프제 성격분석 ","description":"친선도모형\\n\\n\\n동정심이 많고 다른 사람에게 관심을 쏟으며 인화를 중시한다. 타고난 협력자로서 동료애가 많고 친절하며 능동적인 구성원이다. 이야기 하기를 즐기며 정리정돈을 잘하고, 참을성이 많고 다른 사람들을 잘 도와준다. 사람을 다루고 행동을 요구하는 분야, 예를 들면 교직, 성직, 판매 특히 동정심을 필요로 하는 간호나 의료 분야에 적합하다. 일이나 사람 관련 문제에 대하여 냉철한 입장을 취하기 어려워한다. 반대 의견에 부딪혔을 때나, 자신의 요구가 거절 당했을 때 마음의 상처를 받는다.\\n\\n겉보기 특성 - 건강할 경우 사회성이 풍부하며 정이 많고 사람들을 잘 다룬다. 타인의 감정을 잘 배려하는 편이라 막상 타인이 듣기에 어려워하는 말은 보통 생략하는 편이다. 하지만 불건강할 경우 이간질이 심한 편이며 자기가 마음에 안드는 상대면 따돌림도 심심치 않게 하는편","imageId":"c639aed5-d45f-4485-b76e-64de2185e700","original":{"source":"youtube","videoId":"-GrxbERaryw","url":"https://youtu.be/-GrxbERaryw?t=57","isScrapping":true,"metadata":{"title":"ESFJ (엣프제)가 친절한 이유 - YouTube","description":"MBTI 16가지 유형 중 가장 사교적인 유형인 ESFJ (엣프제) 유형에 대해서 설명합니다. (그림 instagram twitter @_lamang)#ESFJ#엣프제#MBTI00:00 인트로01:05 ESFJ의 두가지 특징02:38 ESFJ가 잘하는 일05:14 ESFJ의 인간관...","keywords":"MBTI, ISTP, INTP, ESTP, ENTP, ISFP, INFP, ESFP, ENFP, ISTJ, INTJ, ESTJ, ENTJ, ISFJ, INFJ, ESFJ, ENFJ, 칼 융, 심리유형, 성격유형, 엣프제","ogImage":"https://i.ytimg.com/vi/-GrxbERaryw/maxresdefault.jpg","ogTitle":"ESFJ (엣프제)가 친절한 이유"},"isControls":true},"foldNode":{"title":"[MBTI] ESFJ 엣프제 성격분석 ","description":"친선도모형\\n\\n\\n동정심이 많고 다른 사람에게 관심을 쏟으며 인화를 중시한다. 타고난 협력자로서 동료애가 많고 친절하며 능동적인 구성원이다. 이야기 하기를 즐기며 정리정돈을 잘하고, 참을성이 많고 다른 사람들을 잘 도와준다. 사람을 다루고 행동을 요구하는 분야, 예를 들면 교직, 성직, 판매 특히 동정심을 필요로 하는 간호나 의료 분야에 적합하다. 일이나 사람 관련 문제에 대하여 냉철한 입장을 취하기 어려워한다. 반대 의견에 부딪혔을 때나, 자신의 요구가 거절 당했을 때 마음의 상처를 받는다.\\n\\n겉보기 특성 - 건강할 경우 사회성이 풍부하며 정이 많고 사람들을 잘 다룬다. 타인의 감정을 잘 배려하는 편이라 막상 타인이 듣기에 어려워하는 말은 보통 생략하는 편이다. 하지만 불건강할 경우 이간질이 심한 편이며 자기가 마음에 안드는 상대면 따돌림도 심심치 않게 하는편"},
