      "id":"fold-8-20220622114008","type":"fold","uid":8,"label":"","title":"[군대] 만화 - 유격행군","description":"유격 훈련은 군사 적지나 전열 밖에서 그때그때 형편에 따라 적을 기습적으로 공격하는 전술을 익히는 훈련을 말한다.\\n\\n유격 훈련은 자신이 장교건 부사관이건 병이건 모두 훈련을 받으며 계급 불문하고 교육생 신분이다! 따라서 일정에 소개된 내용은 장교건 부사관이건 병이건 동등하다.\\n\\n아래에 나온 일정은 일반적인 보병사단을 기준으로 한 것으로, 기행부대의 경우 2박 3일 이내로 훨씬 더 짧은 일정으로 소화한다는 점을 유의할 것. 물론 당일치기로 끝내버리는 부대도 있다.\\n심한 부대는 아예 흉내만 내거나 안 하기도 한다.\\n\\n참고로 대한민국 군무원은 계급 불문하고 유격 훈련을 거의 받지 않는다\\n\\n\\n","imageId":"51c2daf0-e736-4b77-ba68-0b9b18b27b00","original":{"source":"youtube","videoId":"GiXmusq921A","url":"https://youtu.be/GiXmusq921A","isScrapping":true,"metadata":{"title":"[신병] 유격행군 - YouTube","description":"스튜디오 장삐쭈장삐쭈 ,  정영준 , 안류천  , 포포 , 윤성원 , 허혜원support : 정대준","keywords":"장삐쭈, 삐쭈, ㅋㅋㅋ, 삐쮸, 장삐쮸, 병맛더빙, 더빙, 웃긴동영상, 꿀잼, 신병, 초병, 장삐쭈 단편선, 단편선, 창작애니, 볼만한 애니, 재밌는애니, 웃긴애니, 볼만한애니, 애니추천, 만화추천, UFC, 암바, 장비주","ogImage":"https://i.ytimg.com/vi/GiXmusq921A/maxresdefault.jpg","ogTitle":"[신병] 유격행군"},"isControls":true},"foldNode":{"title":"[군대] 만화 - 유격행군","description":"유격 훈련은 군사 적지나 전열 밖에서 그때그때 형편에 따라 적을 기습적으로 공격하는 전술을 익히는 훈련을 말한다.\\n\\n유격 훈련은 자신이 장교건 부사관이건 병이건 모두 훈련을 받으며 계급 불문하고 교육생 신분이다! 따라서 일정에 소개된 내용은 장교건 부사관이건 병이건 동등하다.\\n\\n아래에 나온 일정은 일반적인 보병사단을 기준으로 한 것으로, 기행부대의 경우 2박 3일 이내로 훨씬 더 짧은 일정으로 소화한다는 점을 유의할 것. 물론 당일치기로 끝내버리는 부대도 있다.\\n심한 부대는 아예 흉내만 내거나 안 하기도 한다.\\n\\n참고로 대한민국 군무원은 계급 불문하고 유격 훈련을 거의 받지 않는다\\n\\n\\n"},
