      "id":"fold-8-20220622123250","type":"fold","uid":8,"label":"","title":"[군대] 윤일병 사건","description":"2014년 4월 7일, 대한민국 육군 제28보병사단 포병여단 977포병대대 의무대에서 선임 병사들이 후임 병사를 집단 구타해 죽음에 이르게 한 살인 사건. \\n해당 사건의 피해자 윤승주 일병의 이름을 따 윤 일병 사건이라고도 부른다.\\n\\n게다가 조사 과정에서 이들이 그 전부터 행했던 각종 가혹행위들이 하나하나 밝혀졌는데, \\n그 수준이 인간말종 종자들이나 할 짓들이라 온 국민을 분개하게 만들 정도였고, 아울러 대한민국 육군 역대 사건 사고들 중 최악의 살인 사건으로도 꼽힌다.\\n\\n윤승주 일병(사망 당시 21세, 1993년생)이 제977포병대대 의무대 생활관에서 선임 병사들과 만두 등 냉동식품을 나눠 먹던 중, \\n의무대에 파견된 앰뷸런스 운전병인 이찬희 병장(당시 27세, 1988년생)을 포함한 선임병 4명에게 정수리와 가슴 등을 수십차례 구타 당하고 쓰러진 뒤, \\n쓰러진 상태에서 추가적으로 구타와 폭행을 당하다가 결국 사망에 이르게 된 사건이다. \\n\\n윤 일병이 피를 흘리면서 쓰러짐에도 불구하고 가해자들은 생명을 구하는 일엔 아랑곳 없이 폭행을 멈추지 않는 비정함을 보였다. \\n결국 구타로 인해 뇌사 상태에 빠진[5] 윤 일병은 병원으로 긴급 이송됐지만, 결국 다음 날 사망하고 말았다. \\n\\n","imageId":"f6f0f306-8e94-49c6-2d9e-d56ca007b800","original":{"source":"youtube","videoId":"CHqTDxnvYbg","url":"https://youtu.be/CHqTDxnvYbg","isScrapping":true,"metadata":{"title":"미쳐 알지 못했던 윤일병 사건 이야기 - YouTube","description":"이외에도 입에 담기 힘든 많은 진실이 있습니다.군인분들은 이러한 일이 생기면 가족, 언론에게 무조건 신고하시길 바랍니다.윤 일병 가해자들이 출소해서내 주변에서 평범하게 살고 있을 거라고 생각하니 소름 돋네요.시청해주셔서 감사합니다.#윤일병 #DP","keywords":"군인","ogImage":"https://i.ytimg.com/vi/CHqTDxnvYbg/maxresdefault.jpg","ogTitle":"미쳐 알지 못했던 윤일병 사건 이야기"},"isControls":true},"foldNode":{"title":"[군대] 윤일병 사건","description":"2014년 4월 7일, 대한민국 육군 제28보병사단 포병여단 977포병대대 의무대에서 선임 병사들이 후임 병사를 집단 구타해 죽음에 이르게 한 살인 사건. \\n해당 사건의 피해자 윤승주 일병의 이름을 따 윤 일병 사건이라고도 부른다.\\n\\n게다가 조사 과정에서 이들이 그 전부터 행했던 각종 가혹행위들이 하나하나 밝혀졌는데, \\n그 수준이 인간말종 종자들이나 할 짓들이라 온 국민을 분개하게 만들 정도였고, 아울러 대한민국 육군 역대 사건 사고들 중 최악의 살인 사건으로도 꼽힌다.\\n\\n윤승주 일병(사망 당시 21세, 1993년생)이 제977포병대대 의무대 생활관에서 선임 병사들과 만두 등 냉동식품을 나눠 먹던 중, \\n의무대에 파견된 앰뷸런스 운전병인 이찬희 병장(당시 27세, 1988년생)을 포함한 선임병 4명에게 정수리와 가슴 등을 수십차례 구타 당하고 쓰러진 뒤, \\n쓰러진 상태에서 추가적으로 구타와 폭행을 당하다가 결국 사망에 이르게 된 사건이다. \\n\\n윤 일병이 피를 흘리면서 쓰러짐에도 불구하고 가해자들은 생명을 구하는 일엔 아랑곳 없이 폭행을 멈추지 않는 비정함을 보였다. \\n결국 구타로 인해 뇌사 상태에 빠진[5] 윤 일병은 병원으로 긴급 이송됐지만, 결국 다음 날 사망하고 말았다. \\n\\n"},
