      "id":"fold-8-20220622124256","type":"fold","uid":8,"label":"","title":"[군대] 윤일병 가해자 유경수 하사","description":" 유경수 하사(사건 당시 23세, 1991년생)는 비록 윤 일병을 사망에 이르게 한 폭행에는 가담하지 않았다고 하나, 사병들의 폭행을 방관 및 묵인하고 두둔했을 뿐만 아니라 심지어 폭행(사망 사건 이전)에 가담한 적이 있다고까지 한다. \\n\\n거기에 이찬희 병장, 하선우 병장과 함께 휴가 기간에 성매매를 하기도 했으며, 그 이후로 이찬희 병장과 의형제 같은 사이가 되었다고 한다. \\n\\n나이와 계급을 보면 알겠지만, 전역 직전의 말년병장이 하사에게 형님이라고 하는 흔한 게 아닌 나이 어린 하사가 병장에게 알아서 긴 것이다. \\n계급체계부터 완전히 붕괴된 막장이다. 있어야 하는 군기를 어디 갖다 버리고, 있어서는 안 될 똥군기만 세운 셈이다.","imageId":"1007c300-4248-40d3-9021-774213b28900","original":{"source":"youtube","videoId":"4yoTe_fahMY","url":"https://youtu.be/4yoTe_fahMY?t=150","isScrapping":true,"metadata":{"title":"윤일병 사건, 당신이 몰랐던 12가지 사실 - YouTube","description":"#윤일병","keywords":"인물, 인물소개, 윤일병","ogImage":"https://i.ytimg.com/vi/4yoTe_fahMY/maxresdefault.jpg","ogTitle":"윤일병 사건, 당신이 몰랐던 12가지 사실"},"isControls":true},"foldNode":{"title":"[군대] 윤일병 가해자 유경수 하사","description":" 유경수 하사(사건 당시 23세, 1991년생)는 비록 윤 일병을 사망에 이르게 한 폭행에는 가담하지 않았다고 하나, 사병들의 폭행을 방관 및 묵인하고 두둔했을 뿐만 아니라 심지어 폭행(사망 사건 이전)에 가담한 적이 있다고까지 한다. \\n\\n거기에 이찬희 병장, 하선우 병장과 함께 휴가 기간에 성매매를 하기도 했으며, 그 이후로 이찬희 병장과 의형제 같은 사이가 되었다고 한다. \\n\\n나이와 계급을 보면 알겠지만, 전역 직전의 말년병장이 하사에게 형님이라고 하는 흔한 게 아닌 나이 어린 하사가 병장에게 알아서 긴 것이다. \\n계급체계부터 완전히 붕괴된 막장이다. 있어야 하는 군기를 어디 갖다 버리고, 있어서는 안 될 똥군기만 세운 셈이다."},
