      "id":"fold-8-20220622125139","type":"fold","uid":8,"label":"","title":"[군대] DP(조석봉)","description":"제103보병사단 헌병대 일병. 특임대 소속으로 안준호의 바로 윗고참, 맞선임이다. 미술학원 강사 출신이며[2] 애니를 굉장히 좋아한다. \\n극초반 고참의 쿠사리에서 준호를 유일하게 챙겨주려던 천사 맞선임.\\n\\n부대 내에서 황장수, 류이강을 비롯한 고참들에게 그야말로 막장 수준의 구타, 괴롭힘과 가혹행위를 당해왔고, \\n그 고참의 지시로 어울리지도 않는 내리갈굼을 어설프게 실행하기도 한다.\\n\\n그 과정에서 착하고 유순한 성격이 지속적인 폭행과 괴롭힘으로 정서적 불안정을 보이기 시작하며 서서히 정신이 망가져 가고 극도의 인간 불신에 빠지게 된다.\\n\\n정신적으로 피폐해져 가는 것을 증명이라도 하듯, 등장 초반 살집이 좀 있었던 몸이 점차 살이 빠지고 말라가는 것을 볼 수 있다.","imageId":"1d0cf993-b9da-4a5b-27f2-160d34133300","original":{"source":"youtube","videoId":"tn3kBjmOtT0","url":"https://youtu.be/tn3kBjmOtT0","isScrapping":true,"metadata":{"title":"『D.P』 조석봉 일병의 시점으로 다시보기 - YouTube","description":"작품명 : D.P새로운 영상은 매주 금요일 업로드 됩니다.▼▼▼▼▼▼더 보기 (BGM 정보)▼▼▼▼▼▼붉은 돼지(Porco Rosso) OST - 돌아갈 수 없는 날들(By gone days) Piano cover[피달소] https://youtu.be/h5tTO6SIwkk붉은돼지...","keywords":"품추남, 영화, 추천, 소개, 스토리, 무비, 예고편, 넷플릭스, d.p, 조석봉, 헌병대, 군대, 가혹행위, 부조리, 구타, 헌병, 탈영, 탈영병, 조현철, 정해인, 구교환, 황장수, 안준호, 한호열, ptsd, 입대, 전역","ogImage":"https://i.ytimg.com/vi/tn3kBjmOtT0/maxresdefault.jpg","ogTitle":"『D.P』 조석봉 일병의 시점으로 다시보기"},"isControls":true},"foldNode":{"title":"[군대] DP(조석봉)","description":"제103보병사단 헌병대 일병. 특임대 소속으로 안준호의 바로 윗고참, 맞선임이다. 미술학원 강사 출신이며[2] 애니를 굉장히 좋아한다. \\n극초반 고참의 쿠사리에서 준호를 유일하게 챙겨주려던 천사 맞선임.\\n\\n부대 내에서 황장수, 류이강을 비롯한 고참들에게 그야말로 막장 수준의 구타, 괴롭힘과 가혹행위를 당해왔고, \\n그 고참의 지시로 어울리지도 않는 내리갈굼을 어설프게 실행하기도 한다.\\n\\n그 과정에서 착하고 유순한 성격이 지속적인 폭행과 괴롭힘으로 정서적 불안정을 보이기 시작하며 서서히 정신이 망가져 가고 극도의 인간 불신에 빠지게 된다.\\n\\n정신적으로 피폐해져 가는 것을 증명이라도 하듯, 등장 초반 살집이 좀 있었던 몸이 점차 살이 빠지고 말라가는 것을 볼 수 있다."},
