      "meta_data": "{\"description\":\"군더더기 없이 떨어지는 줄거리, 그 안에서 아름다움과 순수함을 놓지 않는 미야자키 하야오 감독 특유의 영화적 공식이 등장하는 <천공의 성 라퓨타>. 스튜디오 지브리가 선보이는 첫 작품으로, 80년대 영화인 것이 무색하게 느껴질 만큼 연출과 그림체, 스토리 텔링이 고퀄리티여서 인상적이다.\"}",
