      "source": "fold-1-20220619195246",
      "target": "fold-1-20220619203118",
      "link_type": "folding",
      "meta_data": "{\"description\":\"다음날 회사로 온 동훈은 곧바로 상품권을 찾아보지만 이미 지안이 전날 들고 튄 상태.. 동훈은 영문도 모른 채 회사에서 잘릴 위기에 처한다 \"}",
