      "meta_data": "{\"description\":\"사실 지안은 돈을 위해서라면 동훈의 5000만원이 아니라 목숨까지도 빼앗을 수 있었던 상황 당장 자신이 죽겠는데, 남이라고 못죽이겠는가? 이지안은 나쁜년이지만 이해할 수 있는 나쁜년이다\"}",
