      "meta_data": "{\"description\":\"박동훈의 캐릭터를 잘 설명해주는 장면, 돈 5000이 없어져서 당장 인생이 망할 상태인데도, 그깟 알바생에게 심한 말을 못하고 몰래 뒤쫓아가는게 할 수 있는 유일한 일 \\n이때 그녀가 후계동에 사는 이웃 주민이라는 사실을 알게된다\"}",
