      "source": "fold-1-20220619103249",
      "target": "fold-1-20220620113801",
      "link_type": "folding",
      "meta_data": "{\"description\":\"박동훈이  살고 있는 동네 후계동. 사실 후계동은 공간적으로 동훈을 압박하는 공간이기도 하지만, 벼랑 끝에 밀린 그에게 휴식이 되는 공간이기도 하다 후계동 정희네에 모이는 사람들은 서로 치고 박고 싸우면서도, 누구에게 무슨일이 생기면 발벗고 나서는 사람들 동훈을 이해하기 위해선 후계동이란 공간을 먼저 이해해야 한다 \"}",
