      "link_type": "folding",
      "meta_data": "{\"description\":\"미행끝에 다다른 곳은 후계동. 평생을 후계동 토박이로 살아온 동훈은  자신과 이지안이의 공간이 겹친다는 사실을 알고 깜짝 놀란다 사실 후계동이란 공간은  비슷한 처지의 사람들이 서로를 걱정하고 속내를 풀어 낼 수 있는 공간.  그들이 우연히도 \\\"후계동\\\"에 산다는 것은 어쩌면 서로 같은 처지의 인간이라는 반증\"}",
