      "link_type": "folding",
      "meta_data": "{\"description\":\"사실 ISFJ에 성격유형에 딱 맞진 않지만 많은 부분 캡틴아메리카의 성격을 ISFH에 대입하여 설명할 수 있다 살아있는 미국의 화신으로 언제나 진솔하고 신뢰감있는 모습을 보여주기도 하면서 온갖 압박에도 굴하지 않는 영웅적인 면을 보여준다. 다만 공적이 아닌 내적인 인간 캡틴아메리카는  사랑을 제대로 표현하지도 못하고 시야가 좁게 느껴지기도 하다 그는 사실 미국정부를 위해 일한다는 느낌이 있지만 그것은 사실이 아니다 그가 원하는것은 미국의 부흥과 가치를 수호하는 것이지, 자신이 믿고 있는 미국의 가치에 반대되는 일이라면 언제든지 미국정부와 반대되는 언행을 서슴치 않고 저지르는 편 \"}",
