      "meta_data": "{\"description\":\"다른 사람과의 조화를 중요시하고 갈등을 피해 훌륭한 MC로서, 인터뷰어로서 일할 수 있다는 것, 생각보다 인간관계의 폭이 넓지 않다는 것, 스스로 딱히 성실하다고 생각하지 않으며 필요에 의해 혹은 습관적으로 운동을 한다는 것, 딱히 계획이나 목표를 세우지 않지만 현실의 본인의 삶을 충실히 살아낸다는 점을 볼 수 있다 \"}",
