      "source": "fold-8-20220622120803",
      "target": "fold-8-20220622122829",
      "link_type": "folding",
      "meta_data": "{\"description\":\"누군가는 그를 욕하지만 이 사건이후 많은 장병들은 괴롭힘을 피할수 있었음\\n\\n행동자체는 옳지 못했으나\\n사람이 죽어야만 변화하는 군시스템에\\n더 많은 문제가 있다\"}",
