      "meta_data": "{\"description\":\"즉각으로 자신의 감정을 표현하면서도, 아이디어를 자신 혼자의 것으로 유지하지 않고 다른 사람들에게 동기를 부여하며 참여시키는 남자. 다만 자신의 옳다고 믿는 것을 끝까지 고집하고 다른 사람의 의견따위는 쉽게 무시 해버렸던 사람. 수많은 실패를 했지만 반대로 빛나는 성공까지 여러차례 이뤄낸 스티브 잡스는 전형적인 ENTJ \"}",
